// src/App.js
import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import Header from './components/Header';
import MainSection from './components/MainSection';
import Footer from './components/Footer';

function App() {
  return (
    <Router>
      <div className="App">
        <Header /> {/* 页头 */}
        <MainSection /> {/* 主内容区域 */}
        <Footer /> {/* 页脚 */}
      </div>
    </Router>
  );
}

export default App;
